import './Manga.css';
import { useState, useEffect, useRef } from 'react';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

interface Manga {
  idManga: string;
  idPublisher: string;
  title: string;
  summary: string;
  imageUrl: string;
  idAuthor: string[];
  views: number;
  isDeleted: boolean;
  publishDate: Date;
  status: number;
  idGenre: string[];
}

const Manga = () => {
  const [mangas, setMangas] = useState<Manga[]>([
    {
      idManga: '1',
      idPublisher: 'Shonen Jump',
      title: 'Naruto',
      summary: 'A young ninja who seeks recognition and dreams of becoming Hokage.',
      imageUrl: 'data:image/jpeg;base64,',
      idAuthor: ['Masashi Kishimoto'],
      views: 100000,
      isDeleted: false,
      publishDate: new Date('1999-09-21'),
      status: 1,
      idGenre: ['Action', 'Adventure', 'Fantasy']
    },
    {
      idManga: '2',
      idPublisher: 'Shueisha',
      title: 'One Piece',
      summary: 'A story of a pirateâ€™s adventure in search of the One Piece.',
      imageUrl: 'data:image/jpeg;base64,',
      idAuthor: ['Eiichiro Oda'],
      views: 120000,
      isDeleted: false,
      publishDate: new Date('1997-07-22'),
      status: 1,
      idGenre: ['Action', 'Adventure', 'Fantasy']
    },
    {
      idManga: '3',
      idPublisher: 'Kodansha',
      title: 'Attack on Titan',
      summary: 'Humans fight against giants that threaten their survival.',
      imageUrl: 'data:image/jpeg;base64,',
      idAuthor: ['Hajime Isayama'],
      views: 150000,
      isDeleted: true,
      publishDate: new Date('2009-09-09'),
      status: 0,
      idGenre: ['Action', 'Drama', 'Dark Fantasy'],
      
    },
   

  ]);

  const inputSearch = useRef<HTMLInputElement | null>(null);

  useEffect(() => {
    const inputSearchRef = inputSearch.current;

    const handleSearch = () => {
      const value = inputSearchRef?.value.toLowerCase();
      const searchItems = document.querySelectorAll('.container_admin_manage_book_body_table table tbody tr') as NodeListOf<HTMLTableRowElement>;

      searchItems.forEach((item) => {
        const text = item.textContent?.toLowerCase() || '';
        item.style.display = text.includes(value || '') ? '' : 'none';
      });
    };

    if (inputSearchRef) {
      inputSearchRef.addEventListener('keyup', handleSearch);
    }

    return () => {
      if (inputSearchRef) {
        inputSearchRef.removeEventListener('keyup', handleSearch);
      }
    };
  }, []);

  const handleHideManga = (id: string) => {
    toast.success('áº¨n manga thÃ nh cÃ´ng');
    const newMangas = mangas.map((manga) => {
      if (manga.idManga === id) {
        return { ...manga, isDeleted: true };
      }
      return manga;
    });
    setMangas(newMangas);
  };

  const handleRestoreManga = (id: string) => {
    toast.success('KhÃ´i phá»¥c manga thÃ nh cÃ´ng');
    const newMangas = mangas.map((manga) => {
      if (manga.idManga === id) {
        return { ...manga, isDeleted: false };
      }
      return manga;
    });
    setMangas(newMangas);
  };

  const renderButton = (manga: Manga) => {
    if (!manga.isDeleted) {
      return (
        <button className="delete-button" onClick={() => handleHideManga(manga.idManga)}>
          <i className="fas fa-trash"></i> áº¨n
        </button>
      );
    } else {
      return (
        <button className="restore-button" onClick={() => handleRestoreManga(manga.idManga)}>
          <i className="fas fa-trash-restore"></i> KhÃ´i phá»¥c
        </button>
      );
    }
  };

  return (
    <div className="container_admin_manage_book">
      <ToastContainer />
      <div className="container_admin_manage_book_body">
        <div className="container_admin_manage_book_body_title">
          <div className="container_admin_manage_book_body_title_paga">
            <span>Quáº£n lÃ½ manga</span>
          </div>
          <div className="container_admin_manage_book_body_title_search">
            <input type="text" placeholder="TÃ¬m kiáº¿m" ref={inputSearch}></input>
            <button>
              <i className="fas fa-search"></i>
            </button>
          </div>
        </div>
        <div className="container_admin_manage_book_body_table">
          <table>
            <thead>
              <tr>
                <th></th>
                <th>ID Manga</th>
                <th>Title</th>
                <th>Publisher</th>
                <th>Authors</th>
                <th>Genres</th>
                <th>Views</th>
                <th></th>
              </tr>
            </thead>
            <tbody>
              {mangas.map((manga) => (
                <tr key={manga.idManga}>
                  <td className="col_1_1 image_manga">
                    <img src={manga.imageUrl} alt="" />
                  </td>
                  <td className="col_1_1">{manga.idManga}</td>
                  <td className="col_2_1">{manga.title}</td>
                  <td className="col_2_1">{manga.idPublisher}</td>
                  <td className="col_2_1">{manga.idAuthor.join(', ')}</td>
                  <td className="col_2_1">{manga.idGenre.join(', ')}</td>
                  <td className="col_1_1">{manga.views}</td>
                  <td className="col_1_1">{renderButton(manga)}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default Manga;
